I don't know if the compiler engineers are here, but for the `Storage` struct pattern currently in use I have some half baked suggestions:

1. The `Storage` struct should be exposed should a `storage` module such that it supports the following access patterns:

```
#[contract]
mod token {
  struct Storage {
    name: felt,
    symbol: felt
  }

  #[constructor]
  fn constructor(name: felt, symbol: felt) {
    storage::name::write(name);
    storage::symbol::write(symbol);
  }
}
```

This makes sense to me because the current strategy make it unclear that you are adding all of your storage variables into the global namespace opening up the strong potential for identifiers overlapping implicitly.

2. To extend the first suggestion, I would change what I imagine is the current `#[contract]` macros convention of looking for a `Storage` struct, to instead supporting arbitrarily named structs which have the `#[storage]` macro defined above. Let me provide an example and, subsequently, the reasoning:

```
#[contract]
mod token {
  #[storage(Default)]
  struct metadata {
    name: felt,
    symbol: felt
  }

  #[storage]
  struct erc20 {
    balances: Map::<felt, u256>,
    allowances: Map::<(felt, felt), u256>
  }

  #[constructor]
  fn constructor(name: felt, symbol: felt) {
    storage::name::write(name);
    storage::metadata::symbol::write(symbol);
  }

  #[external]
  fn transfer(from: felt, amount: u256) {
    use storage::erc20::balance;

    let current_balance = balance::read(from);
    balance::write(current_balance - amount);
  }
}
```

In the constructor you can see how the `name` and `symbol` identifiers don't clash anymore, removing the need to suffix a `_` like `name_` in the constructor argument identifiers.

You can namespace storage variable for different concerns.

The `Default` argument to the `storage` macro can be allowed once and storage variables marked as `Default` should be available at the root of the `storage` module.

