re: Copy/Drop, is this explanation correct?  cc @Darlington | Argent this is what happens

### Derive macros
```rust
#[derive(Copy, Drop)]
struct Point { x: felt, y: felt }

fn main() -> felt {
    let mut origin = Point { x: 0, y: 0 };
    let p = Point { x: 1, y: 2 };
    let a = origin.x;
    origin.x // returns 0
}
```

These derive macros are used by the compiler to create new¬†items¬†given the token stream of a¬†struct or an enum. Under the hood, the compiler actually generates this code:

```rust
// generated with: format!("impl {name}{derived} of {derived}::<{name}>;\n"));
impl PointCopy of Copy::<Point>;
impl PointDrop of Drop::<Point>;
```

If you remove this macro, the compiler will throw this error

```jsx
error: Variable was previously moved.
 --> main.cairo:31:9
    let mut origin = Point { x: 0, y: 0 };
        ^********^

error: Variable not dropped.
 --> main.cairo:32:9
    let p = Point { x: 1, y: 2 };};
```

With the instruction `let a = origin.x`, we‚Äôre taking ownership of the `origin` variable. Cairo 1 is similar to Rust on this point as a borrow checker makes sure no variable can be used twice and throws the `Variable was previously moved` error. In the return instruction, we're trying to use `origin` by returning `origin.x`, hence the error. By implementing the `Copy` trait for Position, values are implicitly copied instead of taking ownership.

The second error is `Variable not dropped`. In Cairo 1, every variable that is declared must be either returned at the end of the function or dropped. Custom types need top implement the `Drop` trait so that they can be dropped after they‚Äôre used.

