impl StorageAccessFeltArray of StorageAccess::<Array::<felt>> {
    fn read(address_domain: felt, base: StorageBaseAddress, length:usize) -> SyscallResult::<Array::<felt>> {
        Result::Ok(
            let mut index = 0;
            while index < length{
                  storage_read_syscall(
                    address_domain, storage_address_from_base_and_offset(base, index) 
                )?.try_into().expect('Storage array read failed') //append result in an array returned at the end
                index+=1;
