Ok, after few attemps I managed to reproduce in an easy way:
```
#[contract]
mod Lama {
    use array::ArrayTrait;
    use array::SpanTrait;

    fn lama(arr: Array<felt>) -> (u64, Array::<felt>) {
        (unbox(starknet::get_block_info()).block_number, do_stuff(arr))
    }

    fn do_stuff(lama: Array<felt>) -> Array<felt> {
        let mut arr = array_new();
        do_stuff_loop(lama.span(), ref arr);
        arr
    }

    fn do_stuff_loop(mut lama: Span<felt>, ref array: Array<felt>) {
        match gas::get_gas() {
            Option::Some(_) => {},
            Option::None(_) => {
                let mut data = array_new();
                array_append(ref data, 'OOG');
                panic(data);
            },
        }
        match lama.pop_front() {
            Option::Some(call) => {
                array.append(*call);
                do_stuff_loop(lama, ref array);
            },
            Option::None(_) => (),
        }
    }
}

