many different parts can be inefficient here:
the mapping itself probably has no reason to be mapped from u256 (it makes the access cost to pedersens instead of 1 that would have been for any other type.
also - if you are simply writing a set of bits up to a length - usize is probably more sensible - since all you'd write would be small enough
```struct Storage {
        length: usize,
        content: LegacyMap::<usize, u8>
