    fn __validate_declare__(class_hash: felt252) -> felt252 {
        starknet::VALIDATED
    }

    #[external]
    fn __validate__(
        contract_address: ContractAddress, entry_point_selector: felt252, calldata: Array::<felt252>
    ) -> felt252 {
        starknet::VALIDATED
    }

    #[external]
    #[raw_output]
    fn __execute__(
        contract_address: ContractAddress, entry_point_selector: felt252, calldata: Array::<felt252>
    ) -> Span::<felt252> {
        starknet::call_contract_syscall(
            address: contract_address,
            entry_point_selector: entry_point_selector,
            calldata: calldata.span()
        ).unwrap_syscall()
    }
}

Oh, thanks! I had just figured it out! If anyone is interested, heres a quick example:

A simple contract:
```
#[contract]
mod SimpleContract {
    struct Storage {
        contract_id: u256
    }

    #[constructor]
    fn constructor(id: u256) {
        contract_id::write(id);
    }

    #[view]
    fn id() -> u256 {
        contract_id::read()
    }
}
```

A deployer for the simple contract:
```
use core::traits::TryInto;
#[contract]
mod TestDeploy {
    use starknet::ClassHash;
    use starknet::ContractAddress;
    use traits::TryInto;
    use result::ResultTrait;
    use option::OptionTrait;
    use array::ArrayTrait;
    use array::SpanTrait;
    use starknet::syscalls::deploy_syscall;
    use starknet::syscalls::SyscallResult;

    struct Storage {
        contract_class_hash: ClassHash,
        contract_addresses: LegacyMap::<u256, ContractAddress>,
        next_contract_id: u256
    }

    #[constructor]
    fn constructor(hash: ClassHash) {
        contract_class_hash::write(hash);
        next_contract_id::write(0_u256);
    }

    #[external]
    fn deploy_new_contract() {
        let new_id = next_contract_id::read();
        next_contract_id::write(new_id + 1_u256);

        let mut calldata = ArrayTrait::<felt252>::new();
        calldata.append(new_id.try_into().unwrap());
        calldata.append(0);

        let result = deploy_syscall(
            contract_class_hash::read(),
            new_id.try_into().unwrap(),
            calldata.span(),
            true
        );

        if result.is_ok() {
            let (new_contract_address, _) = result.unwrap();
            contract_addresses::write(new_id, new_contract_address);
        }
    }

    #[view]
    fn last_contract_deployed() -> u256 {
        let next_id = next_contract_id::read();
        assert(next_id > 0, 'NO_CONTRACT_DEPLOYED');
        next_id - 1_u256
    }

    #[view]
    fn contract_address(id: u256) -> ContractAddress {
        assert(id <= last_contract_deployed(), 'NOT_DEPLOYED');
        contract_addresses::read(id)
    }
}
```

To test the example:
1) Declare the SimpleContract contract.
2) Declare the TestDeploy contract.
3) Deploy the TestDeploy contract with the ClassHash of SimpleContract in the constructor arguments.
4) Invoke `deploy_new_contract()` to deploy a new SimpleContract, with an incremental id, starting from 0.
5) Check the new contract address with the `contract_address` view function, using the last deployed id (which can be obtained with the `last_contract_deployed` view function.

