Hi @raphael_doukhan, I am not sure you can do it with the `#serde` macro, as the compiler has to know that the `T` type implements the `serde` too.
Here is the approach with a custom struct. Basically, you've to `impl` the `serde` trait for your struct, letting know to the compiler that the generic type `T` must also implements `serde`.

```rust
use array::{ArrayTrait, SpanTrait};
use serde::Serde;
use option::OptionTrait;

#[derive(Drop)]
struct MyStruct<T> {
    my_span: Span<T>
}

impl MyStructSerde<T, impl TSerde: Serde<T>, impl TDrop: Drop<T>> of Serde<MyStruct<T>> {
    fn serialize(self: @MyStruct<T>, ref output: Array<felt252>) {
        self.my_span.serialize(ref output);
        // serialize other fields...
    }

    fn deserialize(ref serialized: Span<felt252>) -> Option<MyStruct<T>> {
        let my_span: Span<T> = Serde::<Span<T>>::deserialize(ref serialized)?;
        // deserialize other fields...

        Option::Some(MyStruct {
            my_span
        })
