Hello, I'm studying the Traits/Methods section on Cairo Book: https://book.cairo-lang.org/ch04-03-method-syntax.html

could anyone help me with a question? the code example for that section is the following:

```rs
use debug::PrintTrait;
#[derive(Copy, Drop)]
struct Rectangle {
    width: u64,
    height: u64,
}

trait RectangleTrait {
    fn area(self: @Rectangle) -> u64;
}

impl RectangleImpl of RectangleTrait {
    fn area(self: @Rectangle) -> u64 {
        (*self.width) * (*self.height)
    }
}

fn main() {
    let rect1 = Rectangle { width: 30, height: 50,  };

    rect1.area().print();
}
```

my question is, a `RectangleTrait` trait was created and there is an implementation called `RectangleImpl`, but in the `main` function it is using an instance of `Rectangle`, not of `RectangleImpl`, why? I mean, idk why that `impl RectangleImpl` name if it isn't used anywhere

hey! Rectangle is the name of the data type. Traits in Cairo - and in our case RectangleTrait is just a collection of functions.
Implementations are linked to traits, because the behavior of the traits functions are defined in the implementation - but they are not linked to specific data structures.
You can have multiple implementations for a single trait, and you can have multiple functions taking different structs as `self` parameter!

An example would be
```rust
struct Person{}
struct Dog{}

trait MakeSound{
  fn talk(self: @Person);
  fn bark(self: @Dog);
}

// the name of the implementation doesn't matter a lot
impl SoundImpl of MakeSound{
  fn talk(self: @Person){
    //...
  }

  fn bark(self: @Dog){
    //...
  }
}

fn main(){
  let dog = Dog{};
  let person = Person{};

  person.talk();
  dog.bark();
}

```
In the example from the book, the `area` function takes a `self: @Rectangle` parameter. This makes it a method of the `Rectangle` data type, allowing us to call it as `rect.area()`, where `rect` is a variable of `Rectangle` type. 

In later examples, you will see 3 different ways of calling the same function: as a method of the type, directly from the implementation, and directly form the trait. The 3 of theme are equivalent.

